description:
    .uni-content {
        font-family: Arial;
        font-size: 15px;
        color: #202020;
        padding: 25px;
    }

    .uni-content p {
        font-size: 15px;
        line-height: 24px;
        padding-bottom: 25px;
        font-family: Verdana, Geneva, sans-serif;
    }

    .uni-content ul li {
        font-size: 15px;
        line-height: 24px;
        padding-bottom: 25px;
        font-family: Verdana, Geneva, sans-serif;
        list-style-type: circle;
    }

    .uni-content p:last-child {
        padding-bottom: 0;
    }

    .uni-content a {
        color: #06c;
        font-size: 15px;
    }

    .uni-content figure {
        background: none;
        border: 0;
        border-radius: 0;
        margin: 0;
        padding: 0;
    }

    .uni-content figure img {
        max-width: 100% !important;
        height: auto !important;
    }

    .uni-title {
        font-family: arial;
        font-size: 28px;
        margin-bottom: 5px;
    }

    .uni-content .sub-title {
        font-size: 20px;
        margin: 0 0 15px 0;
    }

    .uni-content .item {
        display: inline-block;
        margin: 25px 0;
        overflow: hidden;
        position: relative;
        width: 100%;
    }

    .uni-content .item.left figure {
        float: left;
        margin-right: 25px;
        margin-bottom: 25px;
    }

    .uni-content .item.right figure {
        float: right;
        margin-left: 40px;
        margin-bottom: 25px;
    }


Ürün Detayları

Fakir Hobby S Premium 2000 W Fanlı Isıtıcı Gri

Ev ve iş yerlerinde belirli bir alana kadar ısıtma alternatifi sunan ürün, çift kademeli düğmeden ayarlanabilir yapısı ile kısa sürede ısıtma yaparak ortamı ideal sıcaklığa ulaştırır. 1000 ve 2000 watt gücünde ısıtma yapabilir. 

ÖNE ÇIKAN ÖZELLİKLER

Ön panelinde yer alan kontrol düğmesi sayesinde cihazın çalışma durumunu ayarlayabilirsiniz.
Özel plastik malzemeden üretilen dış kabini, darbelere ve çevresel faktörlere karşı dayanıklı yapısı ile uzun ömürlü kullanımı destekler.
Havayı ısıtmak yerine ortama sıcak hava vererek çalıştığından verimli kullanım elde edilmesini sağlar.
Pratik Tasarım
Fanlı ısıtıcı 36 cm yükseklik, 24 cm genişlik ve 15 cm derinliğe sahip olması ile her alanda kullanım için elverişlidir. Sadece 2, 41 kg ağırlığı ile taşımayı kolay bir hale getirir. İdeal ölçüleri sayesinde az alan kaplayarak kullanım rahatlığı sağlar. 
Duvar Aparatı
Düz zeminlerde dengeli duruş sergilemesine ek olarak alt zemini söküldükten sonra beraberinde gelen aparat sayesinde duvara asılabilir. 2 adet uygun çaptaki vida ile rahat monte edilebilir. İsteğe bağlı olarak duvarda ya da herhangi bir zeminde kullanımı ile fonksiyonel bir ürün özelliği sergiler.
Verimli Kullanım
Yanmaz gövde tasarımına sahip olan ısıtıcı modeli hem güvenli hem de konforlu kullanım avantajı sunar. Tasarım üzerinde yer alan lamba sayesinde çalışma durumun takip edilebilir.
